webpackJsonp([0xaecab3823d6d],{357:function(n,s){n.exports={data:{site:{siteMetadata:{title:"lasse.tech",siteUrl:"https://lasse.tech"}},markdownRemark:{excerpt:"Shortcuts Reveal in sidebar:  CTRL  +  SHIFT  +  R Select one similar:  CMD  +  D   Select all similar:  CMD  +  CTRL  +  G Select line…",html:'<h2>Shortcuts</h2>\n<ul>\n<li>Reveal in sidebar: <strong>CTRL</strong> + <strong>SHIFT</strong> + <strong>R</strong></li>\n<li>Select one similar: <strong>CMD</strong> + <strong>D</strong> </li>\n<li>Select all similar: <strong>CMD</strong> + <strong>CTRL</strong> + <strong>G</strong></li>\n<li>Select line: <strong>CMD</strong> + <strong>L</strong></li>\n<li>Select all child elements: <strong>CMD</strong> + <strong>SHIFT</strong> + <strong>J</strong></li>\n<li>Copy line: <strong>CMD</strong> + <strong>SHIFT</strong> + <strong>D</strong></li>\n<li>Switch line: <strong>CMD</strong> + <strong>CTRL</strong> + <strong>↑</strong> or <strong>↓</strong></li>\n<li>Toggle sidebar: <strong>CMD</strong> + <strong>K</strong> + <strong>B</strong> </li>\n<li>Close HTML tag <em>(useful for JSX when normal HTML autocomplete doesn\'t work)</em>: <strong>alt</strong> + <strong>CMD</strong> + <strong>.</strong></li>\n</ul>\n<h2>Configuration</h2>\n<div class="gatsby-highlight" data-language="javascript">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token punctuation">{</span>\n  <span class="token comment">// Hidden from search, but not sidebar</span>\n  <span class="token string">"binary_file_patterns"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n  <span class="token comment">// Hidden from search and sidebar</span>\n  <span class="token string">"file_exclude_patterns"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span> <span class="token string">".DS_store"</span><span class="token punctuation">,</span> <span class="token string">"*.map"</span><span class="token punctuation">,</span> <span class="token string">"*.min.js"</span><span class="token punctuation">,</span> <span class="token string">"*.min.css"</span> <span class="token punctuation">]</span><span class="token punctuation">,</span>\n  <span class="token comment">// Hidden from search and sidebar</span>\n  <span class="token string">"folder_exclude_patterns"</span><span class="token punctuation">:</span>\n  <span class="token punctuation">[</span>\n    <span class="token string">".svn"</span><span class="token punctuation">,</span>\n    <span class="token string">".git"</span><span class="token punctuation">,</span>\n    <span class="token string">".hg"</span><span class="token punctuation">,</span>\n    <span class="token string">"CVS"</span><span class="token punctuation">,</span>\n    <span class="token string">".sass-cache"</span><span class="token punctuation">,</span>\n    <span class="token string">"__pycache__"</span><span class="token punctuation">,</span>\n    <span class="token string">".tmp"</span><span class="token punctuation">,</span>\n    <span class="token string">"venv"</span><span class="token punctuation">,</span>\n    <span class="token string">"node_modules"</span>\n  <span class="token punctuation">]</span>\n<span class="token punctuation">}</span></code></pre>\n      </div>\n<h2>Packages</h2>\n<p>I often work with ES6/React, Node and Python. I use these packages:</p>\n<ul>\n<li><a href="https://github.com/alienhard/SublimeAllAutocomplete">All Autocomplete</a></li>\n<li><a href="https://github.com/facelessuser/BracketHighlighter">BracketHighlighter</a></li>\n<li><a href="https://github.com/Monnoroch/ColorHighlighter">Color Highlighter</a></li>\n<li><a href="https://github.com/spadgos/sublime-jsdocs">DocBlockr</a></li>\n<li><a href="https://github.com/sindresorhus/editorconfig-sublime">EditorConfig</a></li>\n<li><a href="https://github.com/SideBarEnhancements-org/SideBarEnhancements">SideBarEnhancements</a></li>\n<li><a href="https://github.com/babel/babel-sublime">Babel &#x26; Babel snippets</a></li>\n<li><a href="https://github.com/jonlabelle/SublimeJsPrettier">PrettierJS</a></li>\n<li><a href="https://github.com/titoBouzout/Dictionaries">Dictionaries</a> <em>Many languages supported.</em></li>\n<li><a href="https://github.com/facelessuser/MarkdownPreview">Markdown preview</a></li>\n</ul>\n<h2>Links</h2>\n<ul>\n<li><a href="http://docs.sublimetext.info/en/latest/reference/keyboard_shortcuts_osx.html">Official keyboard shortcut for Mac OSX</a></li>\n</ul>',frontmatter:{date:"17 June, 2018",path:"/my-sublime-shortcuts-settings-and-packages/",title:"My Sublime shortcuts, settings and packages",tags:["Sublime"]}}},pathContext:{}}}});
